import React, { useEffect } from 'react';
import { Switch, Route } from "react-router-dom"
import Navbar from "./components/Header"
import Search from "./components/pages/Search"
import Cards from "./components/Cards"
import SelectedCard from "./components/SelectedCard"
import { Container, Col, Row } from "reactstrap";
import axios from "axios";

import Mapbox from "./components/Mapbox"
// Latitudes range from -90 to 90, and longitudes range from -180 to 80 42.00000 (5 decimal places)

function App() {
  useEffect(() => {
  axios.get("https://api.random.org/json-rpc/2/invoke?", {
    params: {
      apiKey: process.env.REACT_APP_RANDOM_API_KEY,
      n: 1,
      decimalPlaces: 5
    }
  }).then(res => console.log(res))
  },[])

  return (
    <Container fluid={true}>
      <Row>
        <Col>
          <Navbar />

        </Col>
      </Row>
      <Row>
        <Col>
          <Mapbox />
        </Col>
        <Col>
          <Cards className="border" />
        </Col>
      </Row>
      <Row>
        <Col>
        {/* <SelectedCard /> */}
        </Col>
      </Row>
    </Container>

  );
}

export default App;
